import React from "react";

import { Link, Switch, Route } from "react-router-dom";

export default function Nav() {
  return (
    <div>
      <Switch>
        <Route>
            <Home />
        </Route>
        <Route>
        <Location />
        </Route>
        <Route></Route>
      </Switch>
    </div>
  );
}
